// RAG Identify Lookup (offline) — FULL REPLACE v2-B-FIX8
// FIX: ...base and ...(TOKEN ? ...) spreads

const base = $input.item.json || {};
function s(x){ return x == null ? '' : String(x); }

const RAG_URL = (String($env.RAG_API_URL || 'http://rag-api:8099')).replace(/\/$/, '');
const TOKEN = String($env.RAG_API_TOKEN || '').trim();
const TOP_K = Number($env.RAG_IDENTIFY_TOP_K || 25);

function guessVendor(text){
  const t = (text||'').toUpperCase();
  if (t.includes('DELL EMC') || t.includes('DELL')) return 'Dell EMC';
  if (t.includes('HPE') || t.includes('HEWLETT')) return 'HPE';
  if (t.includes('LENOVO')) return 'Lenovo';
  if (t.includes('NETAPP')) return 'NetApp';
  if (t.includes('CISCO')) return 'Cisco';
  if (t.includes('BROCADE')) return 'Brocade';
  if (t.includes('HUAWEI')) return 'Huawei';
  if (t.includes('IBM')) return 'IBM';
  return 'N/A';
}
function guessKlass(text){
  const t = (text||'').toUpperCase();
  if (/\bME\d{3,5}\b/.test(t) || t.includes('DISK GROUP') || t.includes('ENCLOSURE')) return 'Storage';
  return 'Other';
}
function clip(x, n){ x=s(x); return x.length<=n?x:x.slice(0,n); }

const evidence = s(base.identify_evidence_text);
const vendor = guessVendor(evidence);
const klass = guessKlass(evidence);
const query = clip((s(base.rag_query_seed).trim() || evidence.replace(/\s+/g,' ').trim()), 380);

if (!vendor || vendor === 'N/A') {
  return [{
    json: {
      ...base,
      identify_rag_best: null,
      identify_rag_hints: '',
      _rag_identify_error: 'vendor_missing',
      rag_identify_query: query,
      rag_identify_vendor: vendor,
      rag_identify_klass: klass,
    }
  }];
}

try {
  const resp = await this.helpers.httpRequest({
    method: 'POST',
    url: `${RAG_URL}/search/all`,
    json: true,
    timeout: 30000,
    headers: {
      ...(TOKEN ? { Authorization: TOKEN.startsWith('Bearer ') ? TOKEN : `Bearer ${TOKEN}` } : {}),
      'Content-Type': 'application/json',
    },
    body: { query, vendor, klass, top_k: TOP_K },
  });

  const docs = Array.isArray(resp?.docs) ? resp.docs : (Array.isArray(resp?.hits?.docs) ? resp.hits.docs : []);
  const cat  = Array.isArray(resp?.event_catalog) ? resp.event_catalog : (Array.isArray(resp?.hits?.event_catalog) ? resp.hits.event_catalog : []);

  let best = null;
  for (const h of cat) {
    const m = s(h.model).trim();
    const c = s(h.class || h.klass).trim();
    if (!m && !c) continue;
    best = {
      vendor: s(h.vendor).trim() || vendor,
      class: c || klass,
      model: m || 'N/A',
      product_name: s(h.product_name || '').trim() || 'N/A',
      ref: s(h.rel_path || h.file_name || '').trim(),
      page: h.page,
      score: h.score,
      phrase: s(h.phrase || '').trim(),
    };
    break;
  }

  if (!best) {
    for (const d of docs) {
      const ex = s(d.excerpt || d.text || '').toUpperCase();
      const mm = ex.match(/\bME\d{3,5}\b/);
      if (mm) { best = { vendor, class: klass, model: mm[0], product_name:'N/A', ref: s(d.rel_path||d.file_name), page:d.page, score:d.score, phrase:'' }; break; }
    }
  }

  const hints = [];
  if (best) {
    const ref = best.ref ? `ref=${best.ref}${best.page!=null?` p.${best.page}`:''}` : '';
    hints.push(`BEST: vendor="${best.vendor}" class="${best.class}" model="${best.model}" ${ref}`.trim());
  }
  let n=0;
  for (const h of cat.slice(0, 8)) {
    const ph = s(h.phrase).trim();
    const m = s(h.model).trim();
    const c = s(h.class||h.klass).trim();
    const ref = s(h.rel_path||h.file_name).trim();
    if (!ph && !m) continue;
    hints.push(`- ${m||'N/A'} | ${c||'N/A'} | ${ph||'.'} | ${ref}${h.page!=null?` p.${h.page}`:''}`.trim());
    if (++n>=8) break;
  }

  return [{
    json: {
      ...base,
      rag_identify_query: query,
      rag_identify_vendor: vendor,
      rag_identify_klass: klass,
      identify_rag_best: best,
      identify_rag_hints: hints.join('\n'),
    }
  }];

} catch (e) {
  return [{
    json: {
      ...base,
      rag_identify_query: query,
      rag_identify_vendor: vendor,
      rag_identify_klass: klass,
      identify_rag_best: null,
      identify_rag_hints: '',
      _rag_identify_error: s(e?.message || e),
    }
  }];
}

