// LLM Request Storage Errors — FULL REPLACE v7.2-dedup
// Fix: Deduplicate identical TSV rows in TABLE: Errors (LLM sometimes repeats rows).
// Keeps strict output: TABLE: Errors + HEADER + rows|N/A
// Memory-safe: store only ollama_meta.

const base = $input.item.json || {};
function s(x){ return x == null ? '' : String(x); }

const OLLAMA_URL = (String($env.OLLAMA_URL || 'http://10.10.200.9:11434')).replace(/\/$/, '');
const model = s(base.model).trim() || 'qwen2.5:32b-instruct-q8_0';
const messages = Array.isArray(base.messages) ? base.messages : [{ role: 'user', content: '' }];

const HEADER = 'Timestamp;Severity;Component;CodeOrPhrase;Message;Source;KB';

const OPTS = {
  temperature: 0,
  top_k: 1,
  top_p: 1,
  num_ctx: Number($env.STORAGE_NUM_CTX || 131072),
  num_predict: Number($env.STORAGE_NUM_PREDICT || 3500),
};

function pickMeta(resp){
  const o = resp || {};
  return {
    model: o.model,
    created_at: o.created_at,
    done: o.done,
    done_reason: o.done_reason,
    total_duration: o.total_duration,
    load_duration: o.load_duration,
    prompt_eval_count: o.prompt_eval_count,
    prompt_eval_duration: o.prompt_eval_duration,
    eval_count: o.eval_count,
    eval_duration: o.eval_duration,
  };
}

function extractAssistantText(resp){
  if (typeof resp?.message?.content === 'string') return resp.message.content;
  if (typeof resp?.response === 'string') return resp.response;
  return '';
}

function stripThink(t){ return s(t).replace(/<think>[\s\S]*?<\/think>/gi, '').trim(); }
function stripFences(t){
  const x = s(t).trim();
  const m = x.match(/^```[a-z0-9_-]*\s*([\s\S]*?)\s*```$/i);
  return m ? m[1].trim() : x;
}

// Keep only TABLE: Errors block (if model outputs extra garbage)
function extractErrorsBlock(raw){
  let t = stripFences(stripThink(raw));
  t = t.replace(/\r\n/g, '\n');

  // Find first occurrence of TABLE: Errors
  const idx = t.toLowerCase().indexOf('table: errors');
  if (idx === -1) return t.trim();

  t = t.slice(idx).trim();

  // If there are other "TABLE:" sections after errors, cut before them
  const rest = t.slice('TABLE: Errors'.length);
  const nextTable = rest.toLowerCase().indexOf('\ntable: ');
  if (nextTable !== -1) {
    t = ('TABLE: Errors' + rest.slice(0, nextTable)).trim();
  }
  return t.trim();
}

// Ensure strict format and dedupe rows
function normalizeAndDedupe(tableText){
  let t = s(tableText).replace(/\r\n/g, '\n').trim();

  // If model returned only rows without TABLE label, add it
  if (!t.toLowerCase().startsWith('table: errors')) {
    // If it starts with header, prepend TABLE
    if (t.startsWith(HEADER)) t = `TABLE: Errors\n${t}`;
    else t = `TABLE: Errors\n${HEADER}\nN/A`;
  }

  const lines = t.split('\n').map(x => x.trim()).filter(x => x.length > 0);

  // Locate TABLE line
  let tableI = lines.findIndex(x => x.toLowerCase() === 'table: errors');
  if (tableI === -1) tableI = 0;

  // Locate header line after TABLE
  let headerI = -1;
  for (let i = tableI + 1; i < lines.length; i++) {
    if (lines[i] === HEADER) { headerI = i; break; }
  }

  // If missing header, force minimal
  if (headerI === -1) {
    return { out: `TABLE: Errors\n${HEADER}\nN/A`, removed: 0 };
  }

  // Data lines after header
  const data = [];
  for (let i = headerI + 1; i < lines.length; i++) {
    const ln = lines[i];
    if (!ln) continue;
    // stop if a new TABLE starts (safety)
    if (ln.toLowerCase().startsWith('table: ')) break;
    data.push(ln);
  }

  // If model repeated header in middle — remove those
  const filtered = data.filter(x => x !== HEADER);

  // Dedup exact duplicate rows
  const seen = new Set();
  const uniq = [];
  let removed = 0;
  for (const row of filtered) {
    const key = row.trim();
    if (!key) continue;
    if (key.toUpperCase() === 'N/A') {
      // Keep only one N/A if there are no real rows
      continue;
    }
    if (seen.has(key)) { removed++; continue; }
    seen.add(key);
    uniq.push(key);
  }

  const finalRows = uniq.length ? uniq : ['N/A'];

  const out = [
    'TABLE: Errors',
    HEADER,
    ...finalRows
  ].join('\n').trim();

  return { out, removed };
}

function looksValid(tableText){
  const t = s(tableText).replace(/\r\n/g, '\n').trim();
  return t.toLowerCase().includes('table: errors') && t.includes(HEADER);
}

async function callOllama(msgs){
  return await this.helpers.httpRequest({
    method: 'POST',
    url: `${OLLAMA_URL}/api/chat`,
    json: true,
    body: {
      model,
      stream: false,
      messages: msgs,
      options: OPTS,
    },
    timeout: 3600000,
  });
}

try {
  // 1) Main call
  const resp1 = await callOllama.call(this, messages);
  const raw1 = extractAssistantText(resp1);
  const block1 = extractErrorsBlock(raw1);
  let { out: norm1, removed: removed1 } = normalizeAndDedupe(block1);

  // 2) Optional repair if missing TABLE/HEADER
  if (!looksValid(norm1)) {
    const repairPrompt =
      `REPAIR OUTPUT. Return ONLY:\nTABLE: Errors\n${HEADER}\n<rows or N/A>\n\nHere is your previous output:\n<<<\n${block1}\n>>>`;
    const resp2 = await callOllama.call(this, [{ role: 'user', content: repairPrompt }]);
    const raw2 = extractAssistantText(resp2);
    const block2 = extractErrorsBlock(raw2);
    const fixed = normalizeAndDedupe(block2);
    norm1 = fixed.out;
    removed1 += fixed.removed;
  }

  return [{
    json: {
      ...base,
      model,
      ollama_meta: pickMeta(resp1),
      message: { role: 'assistant', content: norm1 },
      _errors_dedup_removed: removed1,
    }
  }];

} catch (e) {
  const status = e?.response?.status || e?.statusCode || '';
  const data = e?.response?.data ? JSON.stringify(e.response.data).slice(0, 1200) : '';
  return [{
    json: {
      ...base,
      model,
      message: { role: 'assistant', content: `[LLM ERROR] status=${status} ${e?.message || e}` },
      _llm_error: true,
      _llm_error_status: status,
      _llm_error_data: data,
    }
  }];
}

